const CharacterList = props => {
    const characterElements = props.characters.map(character => {
        return <li key={character.id}>
            <CharacterCard />
        </li>
    })

    return (
        <section className="main__cards">
            <ul>
                {characterElements}
            </ul>
        </section>
    )
}

export default CharacterList;
